import React from 'react';

export default function Bug( {bug, toggleBug} ){

	function handleCheckbox() {
		toggleBug(bug.id);
	}

	function handleBugClick() {
		return <p> hello </p>

	}


	return (
		<li className="list-group-item" onClick={handleBugClick}>
			<input className="form-check-input me-1" type="checkbox" checked={bug.complete} onChange={handleCheckbox} />
			{bug.name}
		</li>
	);
}
